import React, { useState } from 'react';

const MarksAdd = () => {
  const [year, setYear] = useState('');
  const [course, setCourse] = useState('');
  const [batch, setBatch] = useState('');
  const [stuID, setStuID] = useState('');
  const [subName, setSubName] = useState('');
  const [marks, setMarks] = useState('');

  const handleYearChange = (event) => {
    setYear(event.target.value);
  };

  const handleCourseChange = (event) => {
    setCourse(event.target.value);
  };

  const handleBatchChange = (event) => {
    setBatch(event.target.value);
  };

  const handleStuIDChange = (event) => {
    setStuID(event.target.value);
  };

  const handleSubNameChange = (event) => {
    setSubName(event.target.value);
  };

  const handleMarksChange = (event) => {
    setMarks(event.target.value);
  };

  const handleCancel = () => {
    // Handle cancel logic here
  };

  const handleSubmit = () => {
    // Handle submit logic here
  };

  return (
    <div>
      <h3>Year: {year}</h3>
      <select value={year} onChange={handleYearChange}>
        <option value="">Select an option</option>
        <option value="option1">Option 1</option>
        <option value="option2">Option 2</option>
        <option value="option3">Option 3</option>
      </select>
      <h3>Course: {course}</h3>
      <select value={course} onChange={handleCourseChange}>
        <option value="">Select an option</option>
        <option value="option1">Option 1</option>
        <option value="option2">Option 2</option>
        <option value="option3">Option 3</option>
      </select>
      <h3>Batch: {batch}</h3>
      <select value={batch} onChange={handleBatchChange}>
        <option value="">Select an option</option>
        <option value="option1">Option 1</option>
        <option value="option2">Option 2</option>
        <option value="option3">Option 3</option>
      </select>
      <h3>Stu ID:</h3>
      <input type="text" value={stuID} onChange={handleStuIDChange} />
      <h3>Sub Name:</h3>
      <input type="text" value={subName} onChange={handleSubNameChange} />
      <h3>Marks:</h3>
      <input type="text" value={marks} onChange={handleMarksChange} />
      <br />
      <button onClick={handleCancel}>Cancel</button>
      <button onClick={handleSubmit}>Submit</button>
    </div>
  );
};

export default MarksAdd;
